!
! This Fortran module contains a number of subroutines that return carbon dioxide properties calculated using an interpolated
! Helmholtz free energy and its analytical derivatives.  The main property subroutines are:
!
!   CO2_TD(T, D, error_code, temp, pres, dens, enth, entr, ssnd)
!   CO2_TP(T, P, error_code, temp, pres, dens, enth, entr, ssnd)
!   CO2_PH(P, H, error_code, temp, pres, dens, enth, entr, ssnd)
!   CO2_PS(P, S, error_code, temp, pres, dens, enth, entr, ssnd)
!   CO2_HS(H, S, error_code, temp, pres, dens, enth, entr, ssnd)
!
! The first two arguments are required inputs that correspond to the known independent properties:
!
!   T -- temperature (K)
!   D -- density (kg/m3)
!   P -- pressure (kPa)
!   H -- enthalpy (kJ/kg)
!   S -- entropy (kJ/kg-K)
!
! Each subroutine requires only a single output (error_code), which is an integer used to indicate
! success (value is 0), an error (positive value), or a warning (negative value).  If an error or
! warning occurs, the function CO2_error_message(error_code), which returns a 255 character string,
! can be used to get more information about the error code.
!
! All of the remaining arguments in the subroutines are optional outputs:
!
!   temp -- temperature (K)
!   pres -- pressure (kPa)
!   dens -- density (kg/m3)
!   enth -- enthalpy (kJ/kg)
!   entr -- entropy (kJ/kg-K)
!   ssnd -- speed of sound in the fluid (m/s) 
!
! Notes:
!   1) The thermodynamic state is only explicitly defined in temperature and density.  Therefore, any other combination of
!      known properties requires iteration and may result in a state that does not exactly correspond to the provided properties.
!      For this reason, the values that are returned for the specified properties may not be identical to the inputs.  However,
!      the returned values do exactly correspond to the thermodynamic state defined by the returned temperature and density.
!   2) The CO2_info subroutine provides the molar mass and the critical temperature, pressure, and density of the fluid.
!   3) The CO2_limits subroutine provides temperature and pressure limits for this implementation of FIT.
!   4) All values are double precision with the exception of 'error_code', which is an integer.
!   5) All subroutines and functions are elemental, meaning arrays of inputs and outputs can be used.
!
! Examples:
!   call CO2_TD(T=T, D=D, error_code=error_code, pres=pressure)
!   call CO2_TP(T=temp, P=pres, error_code=err_flag, ssnd=speed_of_sound)
!   call CO2_PH(P=pres_array, H=enth_array, error_code=error_code_array, dens=D_array, temp=temp_array)
!   call CO2_PS(P=pres_out, S=entr_out, error_code=err, enth=enth_out, temp=temp_out)
!
! For more information, contact Northland Numerics at: support@nnumerics.com
!
! ----------------------------------------------------------------------------------------------------------------------------------

module CO2_properties

implicit none

private
public :: CO2_info, CO2_limits, CO2_error_message
public :: CO2_TD, CO2_TP, CO2_PH, CO2_PS, CO2_HS

integer, parameter  :: dp = selected_real_kind(15)
real(dp), parameter :: T_crit = 304.1282_dp
real(dp), parameter :: P_crit = 7377.3_dp
real(dp), parameter :: D_crit = 467.6_dp
real(dp), parameter :: wmm = 44.0098_dp
real(dp), parameter :: T_lower_limit = 303_dp
real(dp), parameter :: T_upper_limit = 1000_dp
real(dp), parameter :: P_lower_limit = 100_dp
real(dp), parameter :: P_upper_limit = 60000_dp
real(dp), parameter :: T_sat_min = 303_dp
real(dp), parameter :: P_sat_min = 7189.0102_dp
real(dp), parameter :: D_form_switch = 280_dp

type Element
    real(dp) :: x_low, inv_dx, y_low, inv_dy, coefs(6,6)
end type Element

contains

subroutine CO2_info(molar_mass, T_critical, D_critical, P_critical)
    real(dp), intent(out), optional :: molar_mass, T_critical, D_critical, P_critical
    if (present(molar_mass)) molar_mass = wmm
    if (present(T_critical)) T_critical = T_crit
    if (present(D_critical)) D_critical = D_crit
    if (present(P_critical)) P_critical = P_crit
end subroutine CO2_info

subroutine CO2_limits(temp_lower, temp_upper, pres_lower, pres_upper, sat_temp_min, sat_pres_min)
    real(dp), intent(out), optional :: temp_lower, temp_upper, pres_lower, pres_upper, sat_temp_min, sat_pres_min
    if (present(temp_lower)) temp_lower = T_lower_limit
    if (present(temp_upper)) temp_upper = T_upper_limit
    if (present(pres_lower)) pres_lower = P_lower_limit
    if (present(pres_upper)) pres_upper = P_upper_limit
    if (present(sat_temp_min)) sat_temp_min = T_sat_min
    if (present(sat_pres_min)) sat_pres_min = P_sat_min
end subroutine CO2_limits

elemental function CO2_error_message(error_code) result(s)
    integer, intent(in) :: error_code
    character(len=255)  :: s
    select case (error_code)
    case (0); s = ''
    case (-101); s = 'CO2_TD: at least one property was requested that is not available for a two-phase fluid'
    case (101); s = 'CO2_TD: specified temperature below minimum value of 303 K'
    case (102); s = 'CO2_TD: specified temperature above maximum value of 1,000 K'
    case (103); s = 'CO2_TD: specified inputs result in pressure below minimum value of 100 kPa'
    case (104); s = 'CO2_TD: specified inputs result in pressure above maximum value of 60,000 kPa'
    case (201); s = 'CO2_TP: specified temperature below minimum value of 303 K'
    case (202); s = 'CO2_TP: specified temperature above maximum value of 1,000 K'
    case (203); s = 'CO2_TP: specified pressure below minimum value of 100 kPa'
    case (204); s = 'CO2_TP: specified pressure above maximum value of 60,000 kPa'
    case (205); s = 'CO2_TP: specified temperature and pressure correspond to saturation point; state is undefined'
    case (206); s = 'CO2_TP: an error occurred while solving for the density that corresponds to the specified pressure'
    case (-301); s = 'CO2_PH: at least one property was requested that is not available for a two-phase fluid'
    case (301); s = 'CO2_PH: specified inputs result in temperature below minimum value of 303 K'
    case (302); s = 'CO2_PH: specified inputs result in temperature above maximum value of 1,000 K'
    case (303); s = 'CO2_PH: specified pressure below minimum value of 100 kPa'
    case (304); s = 'CO2_PH: specified pressure above maximum value of 60,000 kPa'
    case (305); s = 'CO2_PH: an error occurred when solving for the T and D that corresponds to the specified P and H'
    case (-401); s = 'CO2_PS: at least one property was requested that is not available for a two-phase fluid'
    case (401); s = 'CO2_PS: specified inputs result in temperature below minimum value of 303 K'
    case (402); s = 'CO2_PS: specified inputs result in temperature above maximum value of 1,000 K'
    case (403); s = 'CO2_PS: specified pressure below minimum value of 100 kPa'
    case (404); s = 'CO2_PS: specified pressure above maximum value of 60,000 kPa'
    case (405); s = 'CO2_PS: an error occurred when solving for the T and D that corresponds to the specified P and H'
    case (505); s = 'CO2_HS: an error occurred when solving for the T and D that corresponds to the specified H and S'
    case (-501); s = 'CO2_HS: at least one property was requested that is not available for a two-phase fluid'
    case (501); s = 'CO2_HS: specified inputs result in temperature below minimum value of 303 K'
    case (502); s = 'CO2_HS: specified inputs result in temperature above maximum value of 1,000 K'
    case (503); s = 'CO2_HS: specified inputs result in pressure below minimum value of 100 kPa'
    case (504); s = 'CO2_HS: specified inputs result in pressure above maximum value of 60,000 kPa'
    case default; s = 'an unknown error occurred'
    end select
end function CO2_error_message

elemental subroutine CO2_TD(T, D, error_code, temp, pres, dens, enth, entr, ssnd)
    real(dp), intent(in) :: T, D
    integer, intent(out) :: error_code
    real(dp), intent(out), optional :: temp, pres, dens, enth, entr, ssnd
    real(dp) :: P, Q, x, y, f, dfdT, dfdT2, dfdD, dfdD2, dfdDdT
    real(dp) :: dens_vap, f_vap, dfdT_vap, dfdD_vap, prop_vap
    real(dp) :: dens_liq, f_liq, dfdT_liq, dfdD_liq, prop_liq
    type(Element) :: e
    error_code = 0
    dens_vap = -100.0_dp
    if (T < T_crit) then
        if (T < T_lower_limit) then
            error_code = 101
            call zero_outputs(temp, pres, dens, enth, entr, ssnd)
            return
        end if
        dens_liq = CO2_sat_liq_dens(T)
        if (D < dens_liq) then
            dens_vap = CO2_sat_vap_dens(T)
            if (D > dens_vap) then  ! two-phase
                e = find_element(T, dens_liq)
                x = (dens_liq - e%x_low) * e%inv_dx
                y = (T - e%y_low) * e%inv_dy
                call get_two_phase_derivatives(e, x, y, dens_liq, f_liq, dfdD_liq, dfdT_liq)
                e = find_element(T, dens_vap)
                x = (dens_vap - e%x_low) * e%inv_dx
                y = (T - e%y_low) * e%inv_dy
                call get_two_phase_derivatives(e, x, y, dens_vap, f_vap, dfdD_vap, dfdT_vap)
                Q = (dens_vap * (dens_liq - D)) / (D * (dens_liq - dens_vap))  ! rearranged from specific volume def.
                if (present(temp)) temp = T
                if (present(pres)) pres = dens_vap**2 * dfdD_vap  ! vapor pressure slightly more accurate than liquid pressure
                if (present(dens)) dens = D
                if (present(enth)) then
                    prop_liq = f_liq - T * dfdT_liq + dens_liq * dfdD_liq
                    prop_vap = f_vap - T * dfdT_vap + dens_vap * dfdD_vap
                    enth = prop_liq + Q * (prop_vap - prop_liq)
                end if
                if (present(entr)) entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq  ! negative signs change order of terms
                if (present(ssnd)) then
                    ssnd = 0.0_dp
                    error_code = -101
                end if
                return
            end if
        end if
    else if (T > T_upper_limit) then
        error_code = 102
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    e = find_element(T, D)
    x = (D - e%x_low) * e%inv_dx
    y = (T - e%y_low) * e%inv_dy
    call get_derivatives(e, x, y, D, f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2)
    P = D**2 * dfdD
    if (x < 0.0_dp .or. P < P_lower_limit) then
        error_code = 103
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (x > 1.0_dp .or. y > 1.0_dp .or. P > P_upper_limit) then
        error_code = 104
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if

    if (present(temp)) temp = T
    if (present(pres)) pres = P
    if (present(dens)) dens = D
    if (present(enth)) enth = f - T * dfdT + D * dfdD
    if (present(entr)) entr = -dfdT
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * D**2 * (dfdD2 - dfdDdT**2 / dfdT2 + 2.0_dp * dfdD / D) )
end subroutine CO2_TD

elemental subroutine CO2_TP(T, P, error_code, temp, pres, dens, enth, entr, ssnd)
    integer, parameter :: max_iter = 20
    real(dp), parameter :: rel_tol = 1e-10_dp
    real(dp), intent(in) :: T, P
    integer, intent(out) :: error_code
    real(dp), intent(out), optional :: temp, pres, dens, enth, entr, ssnd
    real(dp) :: P_tol, sat_P, D, ln_D, x, y, f, dfdT, dfdT2, dfdD, dfdD2, dfdDdT, residual, dens_vap, dens_liq
    real(dp), dimension(6) :: cy, cy_dT, cy_dT2
    type(Element) :: e
    integer :: iter
    error_code = 0
    dens_vap = 0.0_dp
    dens_liq = 0.0_dp
    P_tol = max(rel_tol, P * rel_tol)
    if (P < P_lower_limit) then
        error_code = 203
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (P > P_upper_limit) then
        error_code = 204
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (T < T_crit) then
        if (T < T_lower_limit) then
            error_code = 201
            call zero_outputs(temp, pres, dens, enth, entr, ssnd)
            return
        end if
        dens_vap = CO2_sat_vap_dens(T)
        dens_liq = CO2_sat_liq_dens(T)
        e = find_element(T, dens_vap)
        y = (T - e%y_low) * e%inv_dy
        x = (dens_vap - e%x_low) * e%inv_dx
        cy = e%coefs(:,1) * y + e%coefs(:,2)
        cy = cy * y + e%coefs(:,3)
        cy = cy * y + e%coefs(:,4)
        cy = cy * y + e%coefs(:,5)
        cy = cy * y + e%coefs(:,6)
        if (e%x_low < D_form_switch) then
            cy(1:3) = cy(1:3) * [4.0_dp, 3.0_dp, 2.0_dp]
            sat_P = dens_vap**2 * (((((cy(1)) * x + cy(2)) * x + cy(3)) * x + cy(4)) * e%inv_dx + cy(6) / dens_vap)
        else
            cy(1:4) = cy(1:4) * [5.0_dp, 4.0_dp, 3.0_dp, 2.0_dp]
            sat_P = dens_vap**2 * ((((((cy(1)) * x + cy(2)) * x + cy(3)) * x + cy(4))) * x + cy(5)) * e%inv_dx
        end if
        if (P < sat_P) then
            D = CO2_pt_vap_dens(P, T)  ! state is vapor
        else if (P > sat_P) then
            D = CO2_pt_liq_dens(P, T)  ! state is liquid
        else
            error_code = 205  ! state is undefined
            call zero_outputs(temp, pres, dens, enth, entr, ssnd)
            return
        end if
    else if (T > T_upper_limit) then
        error_code = 202
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    else
        D = CO2_pt_vap_dens(P, T)  ! state is superheated or supercritical
    end if
    e = find_element(T, D)
    y = (T - e%y_low) * e%inv_dy
    cy = e%coefs(:,1) * y + e%coefs(:,2)
    cy_dT = e%coefs(:,1) * y + cy
    cy = cy * y + e%coefs(:,3)
    cy_dT2 = e%coefs(:,1) * y + cy_dT
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,4)
    cy_dT2 = cy_dT2 * y + cy_dT
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,5)
    cy_dT2 = 2.0_dp * (cy_dT2 * y + cy_dT)
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,6)
    do iter = 1, max_iter
        x = (D - e%x_low) * e%inv_dx

        if (x < -0.01_dp .or. x > 1.01_dp) then  ! outside element
            e = find_element(T, D)
            y = (T - e%y_low) * e%inv_dy
            cy = e%coefs(:,1) * y + e%coefs(:,2)
            cy_dT = e%coefs(:,1) * y + cy
            cy = cy * y + e%coefs(:,3)
            cy_dT2 = e%coefs(:,1) * y + cy_dT
            cy_dT = cy_dT * y + cy
            cy = cy * y + e%coefs(:,4)
            cy_dT2 = cy_dT2 * y + cy_dT
            cy_dT = cy_dT * y + cy
            cy = cy * y + e%coefs(:,5)
            cy_dT2 = 2.0_dp * (cy_dT2 * y + cy_dT)
            cy_dT = cy_dT * y + cy
            cy = cy * y + e%coefs(:,6)
            x = (D - e%x_low) * e%inv_dx
        end if

        if (e%x_low < D_form_switch) then
            dfdD = 4.0_dp * cy(1) * x + 3.0_dp * cy(2)
            dfdD2 = 4.0_dp * cy(1) * x + dfdD
            dfdD = dfdD * x + 2.0_dp * cy(3)
            dfdD2 = dfdD2 * x + dfdD
            dfdD = dfdD * x + cy(4)
            dfdD2 = dfdD2 * e%inv_dx**2
            dfdD = dfdD * e%inv_dx
            dfdD2 = dfdD2 - cy(6) / D**2
            dfdD = dfdD + cy(6) / D
        else
            dfdD = 5.0_dp * cy(1) * x + 4.0_dp * cy(2)
            dfdD2 = 5.0_dp * cy(1) * x + dfdD
            dfdD = dfdD * x + 3.0_dp * cy(3)
            dfdD2 = dfdD2 * x + dfdD
            dfdD = dfdD * x + 2.0_dp * cy(4)
            dfdD2 = dfdD2 * x + dfdD
            dfdD = dfdD * x + cy(5)
            dfdD2 = dfdD2 * e%inv_dx**2
            dfdD = dfdD * e%inv_dx
        end if
        residual = D**2 * dfdD - P
        if (abs(residual) < P_tol) exit
        D = D - residual / (2.0_dp * D * dfdD + D**2 * dfdD2)

    end do
    if (iter >= max_iter) then
        error_code = 206
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (e%x_low < D_form_switch) then
        ln_D = log(D)
        f = (((cy(1) * x + cy(2)) * x + cy(3)) * x + cy(4)) * x + cy(5) + cy(6) * ln_D
        dfdT2 = (((((cy_dT2(1)) * x + cy_dT2(2)) * x + cy_dT2(3)) * x + cy_dT2(4)) * x + cy_dT2(5) + cy_dT2(6) * ln_D) * e%inv_dy**2
        dfdT = cy_dT(1) * x + cy_dT(2)
        dfdDdT = cy_dT(1) * x + dfdT
        dfdT = dfdT * x + cy_dT(3)
        dfdDdT = dfdDdT * x + dfdT
        dfdT = dfdT * x + cy_dT(4)
        dfdDdT = ((dfdDdT * x + dfdT) * e%inv_dx + cy_dT(6) / D) * e%inv_dy
        dfdT = (dfdT * x + cy_dT(5) + cy_dT(6) * ln_D) * e%inv_dy
    else
        f = ((((cy(1) * x + cy(2)) * x + cy(3)) * x + cy(4)) * x + cy(5)) * x + cy(6)
        dfdT2 = (((((cy_dT2(1) * x + cy_dT2(2)) * x + cy_dT2(3)) * x + cy_dT2(4)) * x + cy_dT2(5)) * x + cy_dT2(6)) * e%inv_dy**2
        dfdT = cy_dT(1) * x + cy_dT(2)
        dfdDdT = cy_dT(1) * x + dfdT
        dfdT = dfdT * x + cy_dT(3)
        dfdDdT = dfdDdT * x + dfdT
        dfdT = dfdT * x + cy_dT(4)
        dfdDdT = dfdDdT * x + dfdT
        dfdT = dfdT * x + cy_dT(5)
        dfdDdT = dfdDdT * x + dfdT
        dfdT = dfdT * x + cy_dT(6)
        dfdDdT = dfdDdT * e%inv_dx * e%inv_dy
        dfdT = dfdT * e%inv_dy
    end if

    if (present(temp)) temp = T
    if (present(pres)) pres = D**2 * dfdD
    if (present(dens)) dens = D
    if (present(enth)) enth = f - T * dfdT + D * dfdD
    if (present(entr)) entr = -dfdT
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * D**2 * (dfdD2 - dfdDdT**2 / dfdT2 + 2.0_dp * dfdD / D) )
end subroutine CO2_TP

elemental subroutine CO2_PH(P, H, error_code, temp, pres, dens, enth, entr, ssnd)
    integer, parameter :: max_iter = 20
    real(dp), parameter :: rel_tol = 1e-10_dp
    real(dp), intent(in) :: P, H
    integer, intent(out) :: error_code
    real(dp), intent(out), optional :: temp, pres, dens, enth, entr, ssnd
    real(dp) :: P_tol, H_tol, sat_T, Q, T, D, x, y, f, dfdT, dfdT2, dfdD, dfdD2, dfdDdT
    real(dp) :: dens_vap, f_vap, dfdT_vap, dfdD_vap, enth_vap
    real(dp) :: dens_liq, f_liq, dfdT_liq, dfdD_liq, enth_liq
    real(dp) :: calc_P, calc_H, P_res, H_res, J_11, J_21, J_12, J_22, alpha, beta, gamma, delta_y, delta_x
    type(Element) :: e
    integer :: iter
    error_code = 0
    P_tol = max(rel_tol, P * rel_tol)
    H_tol = max(rel_tol, abs(H) * rel_tol)
    if (P < P_crit) then
        if (P < P_lower_limit) then
            error_code = 303
            call zero_outputs(temp, pres, dens, enth, entr, ssnd)
            return
        end if
        sat_T = CO2_sat_temp(P)
        ! Check saturated vapor state.
        dens_vap = CO2_sat_vap_dens(sat_T)
        e = find_element(sat_T, dens_vap)
        x = (dens_vap - e%x_low) * e%inv_dx
        y = (sat_T - e%y_low) * e%inv_dy
        call get_two_phase_derivatives(e, x, y, dens_vap, f_vap, dfdD_vap, dfdT_vap)
        enth_vap = f_vap - sat_T * dfdT_vap + dens_vap * dfdD_vap
        if (H < enth_vap) then
            ! Check saturated liquid state.
            dens_liq = CO2_sat_liq_dens(sat_T)
            e = find_element(sat_T, dens_liq)
            x = (dens_liq - e%x_low) * e%inv_dx
            y = (sat_T - e%y_low) * e%inv_dy
            call get_two_phase_derivatives(e, x, y, dens_liq, f_liq, dfdD_liq, dfdT_liq)
            enth_liq = f_liq - sat_T * dfdT_liq + dens_liq * dfdD_liq
            if (H > enth_liq) then  ! two-phase
                Q = (H - enth_liq) / (enth_vap - enth_liq)
                D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap)
                if (present(temp)) temp = sat_T
                if (present(pres)) pres = dens_vap**2 * dfdD_vap
                if (present(dens)) dens = D
                if (present(enth)) enth = enth_liq + Q * (enth_vap - enth_liq)
                if (present(entr)) entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq  ! negative signs change order of things
                if (present(ssnd)) then
                    ssnd = 0.0_dp
                    error_code = -301
                end if
                return
            end if
        end if
    else if (P > P_upper_limit) then
        error_code = 304
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    T = CO2_ph_temp(P, H)
    D = CO2_ph_dens(P, H)
    e = find_element(T, D)
    do iter = 1, max_iter
        x = (D - e%x_low) * e%inv_dx
        y = (T - e%y_low) * e%inv_dy
        if (y < -0.01_dp .or. y > 1.01_dp .or. x < -0.01_dp .or. x > 1.01_dp) then  ! outside element
            e = find_element(T, D)
            x = (D - e%x_low) * e%inv_dx
            y = (T - e%y_low) * e%inv_dy
        end if
        call get_derivatives(e, x, y, D, f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2)
        calc_P = D**2 * dfdD
        calc_H = f - T * dfdT + D * dfdD
        P_res = calc_P - P
        H_res = calc_H - H
        if (abs(P_res) < P_tol .and. abs(H_res) < H_tol) exit  ! converged
        ! Create the Jacobian.
        J_11 = 2.0_dp * D * dfdD + D**2 * dfdD2  ! dP_res / dD
        J_12 = D**2 * dfdDdT ! dP_res / dT
        J_21 = dfdD - T * dfdDdT + dfdD + D * dfdD2  ! dH_res / dD
        J_22 = dfdT - dfdT - T * dfdT2 + D * dfdDdT  ! dH_res / dT
        ! Solve J * deltas = residuals for deltas and update x and y.
        alpha = J_21 / J_11
        beta = J_22 - J_12 * alpha
        gamma = H_res - P_res * alpha
        delta_y = gamma / beta
        delta_x = (P_res - J_12 * delta_y) / J_11
        D = D - delta_x
        T = T - delta_y
        if (abs(delta_x) < 1e-12_dp .and. abs(delta_y) < 1e-12_dp) then
            if (abs(P_res) < P_tol * 10_dp .and. abs(H_res) < H_tol * 10_dp) exit  ! converged enough
        end if

    end do
    ! Check for convergence.
    if (iter >= max_iter) then
        error_code = 305
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    ! Check temperature limits.
    if (T < T_lower_limit) then
        error_code = 301
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (T > T_upper_limit) then
        error_code = 302
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    ! Calculate requested properties.
    if (present(temp)) temp = T
    if (present(pres)) pres = calc_P
    if (present(dens)) dens = D
    if (present(enth)) enth = calc_H
    if (present(entr)) entr = -dfdT
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * D**2 * (dfdD2 - dfdDdT**2 / dfdT2 + 2.0_dp * dfdD / D) )
end subroutine CO2_PH

elemental subroutine CO2_PS(P, S, error_code, temp, pres, dens, enth, entr, ssnd)
    integer, parameter :: max_iter = 20
    real(dp), parameter :: rel_tol = 1e-10_dp
    real(dp), intent(in) :: P, S
    integer, intent(out) :: error_code
    real(dp), intent(out), optional :: temp, pres, dens, enth, entr, ssnd
    real(dp) :: P_tol, S_tol, sat_T, Q, T, D, x, y, f, dfdT, dfdT2, dfdD, dfdD2, dfdDdT
    real(dp) :: dens_vap, entr_vap, f_vap, dfdD_vap, dfdT_vap, enth_vap
    real(dp) :: dens_liq, entr_liq, f_liq, dfdD_liq, dfdT_liq, enth_liq
    real(dp) :: calc_P, calc_S, P_res, S_res, J_11, J_21, J_12, J_22, alpha, beta, gamma, delta_y, delta_x
    type(Element) :: e
    integer :: iter
    error_code = 0
    P_tol = max(rel_tol, P * rel_tol)
    S_tol = max(rel_tol, abs(S) * rel_tol)
    if (P < P_crit) then
        if (P < P_lower_limit) then
            error_code = 403
            call zero_outputs(temp, pres, dens, enth, entr, ssnd)
            return
        end if
        sat_T = CO2_sat_temp(P)
        ! Check saturated vapor state.
        dens_vap = CO2_sat_vap_dens(sat_T)
        e = find_element(sat_T, dens_vap)
        x = (dens_vap - e%x_low) * e%inv_dx
        y = (sat_T - e%y_low) * e%inv_dy
        call get_two_phase_derivatives(e, x, y, dens_vap, f_vap, dfdD_vap, dfdT_vap)
        entr_vap = -dfdT_vap
        if (S < entr_vap) then

            ! Check saturated liquid state.
            dens_liq = CO2_sat_liq_dens(sat_T)
            e = find_element(sat_T, dens_liq)
            x = (dens_liq - e%x_low) * e%inv_dx
            y = (sat_T - e%y_low) * e%inv_dy
            call get_two_phase_derivatives(e, x, y, dens_liq, f_liq, dfdD_liq, dfdT_liq)
            entr_liq = -dfdT_liq
            if (S > entr_liq) then  ! two-phase
                Q = (S - entr_liq) / (entr_vap - entr_liq)
                D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap)
                if (present(temp)) temp = sat_T
                if (present(pres)) pres = dens_vap**2 * dfdD_vap
                if (present(dens)) dens = D
                if (present(enth)) then
                    enth_liq = f_liq - sat_T * dfdT_liq + dens_liq * dfdD_liq
                    enth_vap = f_vap - sat_T * dfdT_vap + dens_vap * dfdD_vap
                    enth = enth_liq + Q * (enth_vap - enth_liq)
                end if
                if (present(entr)) entr = entr_liq + Q * (entr_vap - entr_liq)
                if (present(ssnd)) then
                    ssnd = 0.0_dp
                    error_code = -401
                end if
                return
            end if
        end if
    else if (P > P_upper_limit) then
        error_code = 404
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    ! Start with a good guess for T and D.
    T = CO2_ps_temp(P, S)
    D = CO2_ps_dens(P, S)
    e = find_element(T, D)
    do iter = 1, max_iter
        x = (D - e%x_low) * e%inv_dx
        y = (T - e%y_low) * e%inv_dy
        if (y < -0.01_dp .or. y > 1.01_dp .or. x < -0.01_dp .or. x > 1.01_dp) then  ! outside element
            e = find_element(T, D)
            x = (D - e%x_low) * e%inv_dx
            y = (T - e%y_low) * e%inv_dy
        end if
        call get_derivatives(e, x, y, D, f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2)
        calc_P = D**2 * dfdD
        calc_S = -dfdT
        P_res = calc_P - P
        S_res = calc_S - S
        if (abs(P_res) < P_tol .and. abs(S_res) < S_tol) exit  ! converged
        ! Create the Jacobian.
        J_11 = 2.0_dp * D * dfdD + D**2 * dfdD2  ! dP_res / dD
        J_12 = D**2 * dfdDdT ! dP_res / dT
        J_21 = -dfdDdT  ! dS_res / dD
        J_22 = -dfdT2  ! dS_res / dT
        ! Solve J * deltas = residuals for deltas and update x and y.
        alpha = J_21 / J_11
        beta = J_22 - J_12 * alpha
        gamma = S_res - P_res * alpha
        delta_y = gamma / beta
        delta_x = (P_res - J_12 * delta_y) / J_11
        D = D - delta_x
        T = T - delta_y
        if (abs(delta_x) < 1e-12_dp .and. abs(delta_y) < 1e-12_dp) then
            if (abs(P_res) < P_tol * 10_dp .and. abs(S_res) < S_tol * 10_dp) exit  ! converged enough
        end if
    end do
    ! Check for convergence.
    if (iter >= max_iter) then
        error_code = 405
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    ! Check temperature limits.
    if (T < T_lower_limit) then
        error_code = 401
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    if (T > T_upper_limit) then
        error_code = 402
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    ! Calculate requested properties.
    if (present(temp)) temp = T
    if (present(pres)) pres = calc_P
    if (present(dens)) dens = D
    if (present(enth)) enth = f - T * dfdT + D * dfdD
    if (present(entr)) entr = calc_S
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * D**2 * (dfdD2 - dfdDdT**2 / dfdT2 + 2.0_dp * dfdD / D) )
end subroutine CO2_PS

elemental subroutine CO2_HS(H, S, error_code, temp, pres, dens, enth, entr, ssnd)
    integer, parameter :: max_iter = 30
    real(dp), parameter :: rel_tol = 1e-10_dp
    real(dp), intent(in) :: H, S
    integer, intent(out) :: error_code
    real(dp), intent(out), optional :: temp, pres, dens, enth, entr, ssnd
    real(dp) :: T, D, Q, H_tol, S_tol, calc_H, calc_S, H_res, S_res, dhdD, dhdT, dsdD, dsdT, x, y
    real(dp) :: dens_vap, f_vap, dfdT_vap, dfdD_vap
    real(dp) :: dens_liq, f_liq, dfdT_liq, dfdD_liq
    real(dp) :: J_11, J_21, J_12, J_22, alpha, beta, gamma, delta_x, delta_y
    type(Element) :: e
    integer :: iter
    H_tol = max(rel_tol, abs(H) * rel_tol)
    S_tol = max(rel_tol, abs(S) * rel_tol)
    T = CO2_sh_temp(S, H)
    D = CO2_sh_dens(S, H)
    do iter = 1, max_iter
        if (T < T_lower_limit) T = T_lower_limit
        if (D <= 0.0_dp) D = 0.01_dp
        call get_prop_derivatives(T=T, D=D, dhdD_T=dhdD, dsdD_T=dsdD, dhdT_D=dhdT, dsdT_D=dsdT, enth=calc_H, entr=calc_S)
        H_res = calc_H - H
        S_res = calc_S - S
        if (abs(H_res) < H_tol .and. abs(S_res) < S_tol) exit  ! converged
        J_11 = dhdD
        J_12 = dhdT
        J_21 = dsdD
        J_22 = dsdT
        alpha = J_21 / J_11
        beta = J_22 - J_12 * alpha
        gamma = S_res - H_res * alpha
        delta_y = gamma / beta
        delta_x = (H_res - J_12 * delta_y) / J_11
        D = D - delta_x
        T = T - delta_y
        if (abs(delta_x) < 1e-12_dp .and. abs(delta_y) < 1e-12_dp) then
            if (abs(H_res) < H_tol * 10_dp .and. abs(S_res) < S_tol * 10_dp) exit  ! converged enough
        end if
    end do
    if (iter >= max_iter) then  ! did not converge; check two-phase initial guess
        T = CO2_sh_two_phase_temp(S, H)
        dens_liq = CO2_sat_liq_dens(T)
        dens_vap = CO2_sat_vap_dens(T)
        e = find_element(T, dens_liq)
        x = (dens_liq - e%x_low) * e%inv_dx
        y = (T - e%y_low) * e%inv_dy
        call get_two_phase_derivatives(e, x, y, dens_liq, f_liq, dfdD_liq, dfdT_liq)
        e = find_element(T, dens_vap)
        x = (dens_vap - e%x_low) * e%inv_dx
        y = (T - e%y_low) * e%inv_dy
        call get_two_phase_derivatives(e, x, y, dens_vap, f_vap, dfdD_vap, dfdT_vap)
        Q = (S + dfdT_liq) / (dfdT_liq - dfdT_vap)
        D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap)
        do iter = 1, max_iter
            if (T < T_sat_min) T = T_sat_min
            if (D <= 0.0_dp) D = 0.01_dp
            call get_prop_derivatives(T=T, D=D, dhdD_T=dhdD, dsdD_T=dsdD, dhdT_D=dhdT, dsdT_D=dsdT, enth=calc_H, entr=calc_S)
            H_res = calc_H - H
            S_res = calc_S - S
            if (abs(H_res) < H_tol .and. abs(S_res) < S_tol) exit  ! converged
            J_11 = dhdD
            J_12 = dhdT
            J_21 = dsdD
            J_22 = dsdT
            alpha = J_21 / J_11
            beta = J_22 - J_12 * alpha
            gamma = S_res - H_res * alpha
            delta_y = gamma / beta
            delta_x = (H_res - J_12 * delta_y) / J_11
            D = D - delta_x
            T = T - delta_y
            if (abs(delta_x) < 1e-12_dp .and. abs(delta_y) < 1e-12_dp) then
                if (abs(H_res) < H_tol * 10_dp .and. abs(S_res) < S_tol * 10_dp) exit  ! converged enough
            end if
        end do
    end if
    if (iter >= max_iter) then
        error_code = 505
        call zero_outputs(temp, pres, dens, enth, entr, ssnd)
        return
    end if
    call CO2_TD(T, D, error_code, temp, pres, dens, enth, entr, ssnd)
    if (error_code /= 0) then
        if (error_code == -101) error_code = -501
        if (error_code == 101) error_code = 501
        if (error_code == 102) error_code = 502
        if (error_code == 103) error_code = 503
        if (error_code == 104) error_code = 504
    end if
end subroutine CO2_HS

