elemental subroutine get_prop_derivatives(T, D, dPdD_T, dhdD_T, dsdD_T, dPdT_D, dhdT_D, dsdT_D, dDdP_T, dDdT_P, pres, enth, entr)
    real(dp), intent(in) :: T, D
    real(dp), intent(out), optional :: dPdD_T, dhdD_T, dsdD_T, dPdT_D, dhdT_D, dsdT_D, dDdP_T, dDdT_P, pres, enth, entr
    real(dp) :: Q, dQdT, x, y, f, dfdT, dfdT2, dfdD, dfdD2, dfdDdT, part_a, part_b, delta, dome_width
    real(dp) :: dens_vap, d_dens_vap_dT, f_vap, dfdT_vap, dfdT2_vap, dfdD_vap, dfdD2_vap, dfdDdT_vap, enth_vap, enth_vap_dT
    real(dp) :: dens_liq, d_dens_liq_dT, f_liq, dfdT_liq, dfdT2_liq, dfdD_liq, dfdD2_liq, dfdDdT_liq, enth_liq, enth_liq_dT
    type(Element) :: e
    if (T < T_crit) then
        dens_liq = CO2_sat_liq_dens(T)
        if (D < dens_liq) then
            dens_vap = CO2_sat_vap_dens(T)
            if (D > dens_vap) then  ! two-phase
                e = find_element(T, dens_liq)
                x = (dens_liq - e%x_low) * e%inv_dx
                y = (T - e%y_low) * e%inv_dy
                call get_derivatives(e, x, y, dens_liq, f_liq, dfdD_liq, dfdD2_liq, dfdT_liq, dfdDdT_liq, dfdT2_liq)
                e = find_element(T, dens_vap)
                x = (dens_vap - e%x_low) * e%inv_dx
                y = (T - e%y_low) * e%inv_dy
                call get_derivatives(e, x, y, dens_vap, f_vap, dfdD_vap, dfdD2_vap, dfdT_vap, dfdDdT_vap, dfdT2_vap)
                dome_width = dens_liq - dens_vap
                d_dens_liq_dT = CO2_sat_liq_dens_derivative(T)
                d_dens_vap_dT = CO2_sat_vap_dens_derivative(T)
                Q = (dens_vap * (dens_liq - D)) / (D * dome_width)  ! rearranged from specific volume def.
                enth_liq = f_liq - T * dfdT_liq + dens_liq * dfdD_liq
                enth_vap = f_vap - T * dfdT_vap + dens_vap * dfdD_vap
                if (present(dhdT_D) .or. present(dsdT_D)) then
                    delta = d_dens_liq_dT - d_dens_vap_dT
                    part_a = ((dens_liq - D) * d_dens_vap_dT + dens_vap * d_dens_liq_dT) * dome_width
                    part_b = (D - dens_liq) * delta * dens_vap
                    dQdT = (part_a + part_b) / (D * dome_width**2)
                end if
                if (present(dPdD_T)) dPdD_T = 0.0_dp
                if (present(dhdD_T)) dhdD_T = (enth_liq - enth_vap) * dens_liq * dens_vap / (D**2 * dome_width)
                if (present(dsdD_T)) dsdD_T = (dfdT_vap - dfdT_liq) * dens_liq * dens_vap / (D**2 * dome_width)
                if (present(dPdT_D)) then
                    part_a = 2.0_dp * dfdD_vap * d_dens_vap_dT
                    part_b = dens_vap * (dfdDdT_vap + dfdD2_vap * d_dens_vap_dT)
                    dPdT_D = dens_vap * (part_a + part_b)
                end if
                if (present(dhdT_D)) then
                    enth_liq_dT = 2.0_dp * dfdD_liq * d_dens_liq_dT
                    enth_vap_dT = 2.0_dp * dfdD_vap * d_dens_vap_dT
                    enth_liq_dT = enth_liq_dT - T * (dfdT2_liq + dfdDdT_liq * d_dens_liq_dT)
                    enth_vap_dT = enth_vap_dT - T * (dfdT2_vap + dfdDdT_vap * d_dens_vap_dT)
                    enth_liq_dT = enth_liq_dT + dens_liq * (dfdDdT_liq + dfdD2_liq * d_dens_liq_dT)
                    enth_vap_dT = enth_vap_dT + dens_vap * (dfdDdT_vap + dfdD2_vap * d_dens_vap_dT)
                    dhdT_D = enth_liq_dT + Q * (enth_vap_dT - enth_liq_dT) + dQdT * (enth_vap - enth_liq)
                end if
                if (present(dsdT_D)) then
                    part_a = (-dfdT2_liq - dfdDdT_liq * d_dens_liq_dT) + dQdT * (dfdT_liq - dfdT_vap)
                    part_b = (-dfdT2_vap - dfdDdT_vap * d_dens_vap_dT) + dfdT2_liq + dfdDdT_liq * d_dens_liq_dT
                    dsdT_D = part_a + Q * part_b
                end if
                if (present(dDdP_T)) dDdP_T = -9e99_dp  ! NaN: 1/dPdD_T = 1/0
                if (present(dDdT_P)) dDdT_P = -9e99_dp  ! undefined for two-phase?
                if (present(pres)) pres = dens_vap**2 * dfdD_vap
                if (present(enth)) enth = enth_liq + Q * (enth_vap - enth_liq)
                if (present(entr)) entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq  ! negative signs change order of terms
                return
            end if
        end if
    end if
    e = find_element(T, D)
    x = (D - e%x_low) * e%inv_dx
    y = (T - e%y_low) * e%inv_dy
    call get_derivatives(e, x, y, D, f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2)
    if (present(dPdD_T)) dPdD_T = 2.0_dp * D * dfdD + D**2 * dfdD2
    if (present(dhdD_T)) dhdD_T = 2.0_dp * dfdD - T * dfdDdT + D * dfdD2
    if (present(dsdD_T)) dsdD_T = -dfdDdT
    if (present(dPdT_D)) dPdT_D = D**2 * dfdDdT
    if (present(dhdT_D)) dhdT_D = D * dfdDdT - T * dfdT2
    if (present(dsdT_D)) dsdT_D = -dfdT2
    if (present(dDdP_T)) dDdP_T = 1.0_dp / (2.0_dp * D * dfdD + D**2 * dfdD2)
    if (present(dDdT_P)) dDdT_P = -D**2 * dfdDdT / (2.0_dp * D * dfdD + D**2 * dfdD2)
    if (present(pres)) pres = D**2 * dfdD
    if (present(enth)) enth = f - T * dfdT + D * dfdD
    if (present(entr)) entr = -dfdT
end subroutine get_prop_derivatives

elemental subroutine get_derivatives(e, x, y, D, f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2)
    type(Element), intent(in) :: e
    real(dp), intent(in) :: x, y, D
    real(dp), intent(out) :: f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2
    real(dp) :: ln_D, inv_D
    real(dp), dimension(6) :: cy, cy_dT, cy_dT2
    cy = e%coefs(:,1) * y + e%coefs(:,2)
    cy_dT = e%coefs(:,1) * y + cy
    cy = cy * y + e%coefs(:,3)
    cy_dT2 = e%coefs(:,1) * y + cy_dT
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,4)
    cy_dT2 = cy_dT2 * y + cy_dT
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,5)
    cy_dT2 = 2.0_dp * (cy_dT2 * y + cy_dT)
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,6)    
    if (e%x_low < D_form_switch) then
        ln_D = log(D)
        inv_D = 1.0_dp / D
        f = cy(1) * x + cy(2)
        dfdT = cy_dT(1) * x + cy_dT(2)        
        dfdT2 = cy_dT2(1) * x + cy_dT2(2)
        dfdD = cy(1) * x + f
        dfdDdT = cy_dT(1) * x + dfdT
        f = f * x + cy(3)
        dfdT = dfdT * x + cy_dT(3)
        dfdT2 = dfdT2 * x + cy_dT2(3)
        dfdD2 = cy(1) * x + dfdD
        dfdD = dfdD * x + f
        dfdDdT = dfdDdT * x + dfdT
        f = f * x + cy(4)
        dfdT = dfdT * x + cy_dT(4)        
        dfdT2 = dfdT2 * x + cy_dT2(4)
        dfdD2 = 2.0_dp * (dfdD2 * x + dfdD)
        dfdD = dfdD * x + f
        f = f * x + cy(5) + cy(6) * ln_D
        dfdDdT = dfdDdT * x + dfdT
        dfdD = dfdD * e%inv_dx + cy(6) * inv_D
        dfdT = (dfdT * x + cy_dT(5) + cy_dT(6) * ln_D) * e%inv_dy        
        dfdD2 = dfdD2 * e%inv_dx**2 - cy(6) * inv_D**2
        dfdDdT = dfdDdT * e%inv_dx + cy_dT(6) * inv_D       
        dfdT2 = dfdT2 * x + cy_dT2(5) + cy_dT2(6) * ln_D
        dfdDdT = dfdDdT * e%inv_dy
        dfdT2 = dfdT2 * e%inv_dy**2
    else
        f = cy(1) * x + cy(2)
        dfdT = cy_dT(1) * x + cy_dT(2)
        dfdT2 = cy_dT2(1) * x + cy_dT2(2)
        dfdD = cy(1) * x + f
        dfdDdT = cy_dT(1) * x + dfdT
        f = f * x + cy(3)
        dfdT = dfdT * x + cy_dT(3)
        dfdT2 = dfdT2 * x + cy_dT2(3)
        dfdD2 = cy(1) * x + dfdD
        dfdD = dfdD * x + f
        dfdDdT = dfdDdT * x + dfdT
        f = f * x + cy(4)
        dfdT = dfdT * x + cy_dT(4)
        dfdT2 = dfdT2 * x + cy_dT2(4)
        dfdD2 = dfdD2 * x + dfdD
        dfdD = dfdD * x + f
        dfdDdT = dfdDdT * x + dfdT
        f = f * x + cy(5)
        dfdT = dfdT * x + cy_dT(5)
        dfdT2 = dfdT2 * x + cy_dT2(5)
        dfdD2 = 2.0_dp * (dfdD2 * x + dfdD)
        dfdD = dfdD * x + f
        dfdDdT = dfdDdT * x + dfdT
        f = f * x + cy(6)    
        dfdT = dfdT * x + cy_dT(6)
        dfdT2 = dfdT2 * x + cy_dT2(6)
        dfdD = dfdD * e%inv_dx
        dfdT = dfdT * e%inv_dy
        dfdD2 = dfdD2 * e%inv_dx**2
        dfdT2 = dfdT2 * e%inv_dy**2
        dfdDdT = dfdDdT * e%inv_dx * e%inv_dy
    end if
end subroutine get_derivatives

elemental subroutine get_two_phase_derivatives(e, x, y, D, f, dfdD, dfdT)
    type(Element), intent(in) :: e
    real(dp), intent(in) :: x, y, D
    real(dp), intent(out) :: f, dfdD, dfdT
    real(dp) :: ln_D
    real(dp), dimension(6) :: cy, cy_dT
    cy = e%coefs(:,1) * y + e%coefs(:,2)
    cy_dT = e%coefs(:,1) * y + cy
    cy = cy * y + e%coefs(:,3)
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,4)
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,5)
    cy_dT = cy_dT * y + cy
    cy = cy * y + e%coefs(:,6)
    if (e%x_low < D_form_switch) then
        ln_D = log(D)
        f = cy(1) * x + cy(2)
        dfdT = cy_dT(1) * x + cy_dT(2)
        dfdD = cy(1) * x + f
        f = f * x + cy(3)
        dfdT = dfdT * x + cy_dT(3)
        dfdD = dfdD * x + f
        f = f * x + cy(4)
        dfdT = dfdT * x + cy_dT(4)
        dfdD = dfdD * x + f
        f = f * x + cy(5) + cy(6) * ln_D
        dfdT = dfdT * x + cy_dT(5) + cy_dT(6) * ln_D
        dfdD = dfdD * e%inv_dx + cy(6) / D
        dfdT = dfdT * e%inv_dy
    else
        f = cy(1) * x + cy(2)
        dfdT = cy_dT(1) * x + cy_dT(2)
        dfdD = cy(1) * x + f
        f = f * x + cy(3)
        dfdT = dfdT * x + cy_dT(3)
        dfdD = dfdD * x + f
        f = f * x + cy(4)
        dfdT = dfdT * x + cy_dT(4)
        dfdD = dfdD * x + f
        f = f * x + cy(5)
        dfdT = dfdT * x + cy_dT(5)
        dfdD = dfdD * x + f
        f = f * x + cy(6)    
        dfdT = dfdT * x + cy_dT(6)
        dfdD = dfdD * e%inv_dx
        dfdT = dfdT * e%inv_dy
    end if
end subroutine get_two_phase_derivatives

